package main

import (
	"fmt"
	"reflect"
)

func twoSum1(numbers []int, target int) []int {
	if numbers == nil || len(numbers) < 2 {
		return nil
	}

	for low, high := 0, len(numbers)-1; low < high; {
		if sum := numbers[low] + numbers[high]; sum > target {
			high--
		} else if sum < target {
			low++
		} else {
			return []int{low + 1, high + 1}
		}
	}
	return nil
}

func twoSum2(numbers []int, target int) []int {
	// if numbers == nil || len(numbers) < 2 || target < numbers[0] {
	if numbers == nil || len(numbers) < 2 {
		return nil
	}

	for i, l := 0, len(numbers); i < l; i++ {
		if j := binsearch(numbers, target-numbers[i], i+1, l-1); j != -1 {
			return []int{i + 1, j + 1}
		}
	}
	return nil
}

func binsearch(nums []int, target, low, high int) int {
	if low > high {
		return -1
	}
	mid := low + (high-low)>>1

	if nums[mid] < target {
		return binsearch(nums, target, mid+1, high)
	} else if nums[mid] > target {
		return binsearch(nums, target, low, mid-1)
	} else {
		return mid
	}
}

